import { Box, makeStyles, Paper } from "@material-ui/core";
import axios from "axios";
import { useEffect, useState } from "react";

interface CountType {
  branchCount: number;
  clientCount: number;
  contractCount: number;
  contactCount: number;
}

const useStyles = makeStyles({
  container: {
    display: "flex",
    flexDirection: "row",
  },
  root: {
    minWidth: 275,
  },
  bullet: {
    display: "inline-block",
    margin: "0 2px",
    transform: "scale(0.8)",
  },
  title: {
    fontSize: 14,
  },
  pos: {
    marginBottom: 12,
  },
});
const Count = () => {
  const classes = useStyles();
  const [count, setCount] = useState<CountType>(null);

  useEffect(() => {
    axios
      .get("/api/count/getDashboardData")
      .then(({ data }) => {
        setCount(data);
        console.log(data);
      })
      .catch((err) => console.log(err));
  }, []);
  return (
    <Box m={5} className={classes.container}>
      <Paper className={classes.root} elevation={3}>
        <Typography
          color="textsecondary"
          gutterBottom
          component="h1"
          variant="h5"
        >
          Branch Count {count?.branchCount}
        </Typography>
      </Paper>
      <Paper className={classes.root} elevation={3}>
        <Typography
          color="textsecondary"
          gutterBottom
          component="h1"
          variant="h5"
        >
          Client Count {count?.clientCount}
        </Typography>
      </Paper>
      <Paper className={classes.root} elevation={3}>
        <Typography
          color="textsecondary"
          gutterBottom
          component="h1"
          variant="h5"
        >
          ContactPerson Count {count?.contractCount}
        </Typography>
      </Paper>
      <Paper className={classes.root} elevation={3}>
        <Typography
          color="textsecondary"
          gutterBottom
          component="h1"
          variant="h5"
        >
          Contract Count {count?.contractCount}
        </Typography>
      </Paper>
    </Box>
  );
};

export default Count;
